pragma solidity ^0.5.0;

contract Game {
    address[] players;
    mapping(address => bool) eligible;
    mapping(address => bytes32) move_commitment;
    uint MOVE_STEAL = 0;
    uint MOVE_BLOCK = 1;
    uint MOVE_SHARE = 2;
    uint GAME_STATE = 0; // 0 just started, 1 commit move, 2 reveal move, 3 payout, 4 withdrawn
    bool finished;
    mapping(address=>uint256) move;

    constructor() public {
        GAME_STATE = 0;
        finished = false;
    }

    function start() public {
        require(GAME_STATE == 0);
        GAME_STATE = 1; // start committing moves
    }

    function commit_move(bytes32 _m_hash) public {
        require(eligible[msg.sender]);
        move_commitment[msg.sender] = _m_hash;
    }

    function revealMove(uint256 _move, uint256 _salt) public{
        require(_move == 0 || _move == 1 || _move == 2);
        uint256 preimage = (_salt << 2) + _move;
        require(keccak256(abi.encodePacked(preimage)) == move_commitment[msg.sender]);
        move[msg.sender] = _move;
    }
}
